async function getStaticProps() {
    const res = await fetch("http://206.189.56.129/wp-json/wp/v2/aktuality");
    const posts = await res.json();
    var aktuality = [];
    for(let aktualita in posts){
        aktuality.push({
            nadpis: posts[aktualita].title.rendered,
            datum: posts[aktualita].x_date,
            text: posts[aktualita].content.rendered.replace(/(<([^>]+)>)/gi, ""),
            image: posts[aktualita].acf.fotka,
            priloha: posts[aktualita].acf.priloha,
            id: posts[aktualita].id
        });
    }
    aktuality = aktuality.slice(0, 4);
    const res_vina = await fetch("http://206.189.56.129/wp-json/wp/v2/sortiment");
    const raw_vina = await res_vina.json();
    var vina = [];
    for(let vino in raw_vina){
        if (raw_vina[vino].acf.na_hlavni_strane == true) {
            vina.push({
                image: raw_vina[vino].acf.hlavni_obrazek,
                nazev: raw_vina[vino].title.rendered,
                text: raw_vina[vino].acf.kratky_popis.replace(/(<([^>]+)>)/gi, ""),
                rocnik: raw_vina[vino].acf.rocnik,
                cena: raw_vina[vino].acf.cena,
                id: raw_vina[vino].id
            });
        }
    }
    ;
    return {
        props: {
            aktuality,
            vina
        },
        // Next.js will attempt to re-generate the page:
        // - When a request comes in
        // - At most once every 10 seconds
        revalidate: 10
    };
}


